import React from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import { Bar } from 'react-chartjs-2';

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
);

export const options = {
  plugins: {
    title: {
      display: true,
      text: 'LeetCode Category Summary',
    },
  },
  responsive: true,
  scales: {
    x: {
      stacked: true,
    },
    y: {
      stacked: true,
    },
  },
};

const labels = ['Arrays & Hashing', 'Two Pointers', 'Sliding Window', 'Stack', 'Binary Search', 'Linked List', 'Trees'];

export const data = {
  labels,
  datasets: [
    {
      label: 'Easy',
      data: labels.map(() => 100),
      backgroundColor: 'rgb(255, 99, 132)',
    },
    {
      label: 'Medium',
      data: labels.map(() => 200),
      backgroundColor: 'rgb(75, 192, 192)',
    },
    {
      label: 'Easy',
      data: labels.map(() => 300),
      backgroundColor: 'rgb(53, 162, 235)',
    },
  ],
};

export function Dashboard() {
  return <Bar options={options} data={data} />;
}

export default Dashboard;
